// src/index.js
import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import "./styles/variables.css";
import "./styles/global.css";

// Log to verify frontend bundle is running
console.log("RoomieRadar Frontend is running");

// Get root container
const container = document.getElementById("root");

if (!container) throw new Error("Root container (#root) not found");

// Create React root (React 18+)
const root = ReactDOM.createRoot(container);

// Render React app (App.jsx already contains <Router>)
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Optional: Webpack Hot Module Replacement
if (module.hot) {
  module.hot.accept();
}
